window.bookSummaryJSON = "<p>Police procedurals go supernatural in this gritty urban fantasy debut by Michael F. Haspil in <i>Graveyard Shift</i>. </p> <p>Alex Menkaure, former pharaoh and mummy, and his vampire partner, Marcus, born in ancient Rome, are vice cops in a special Miami police unit. They fight to keep the streets safe from criminal vampires, shape-shifters, bootleg blood dealers, and anti-vampire vigilantes. </p> <p>When poisoned artificial blood drives vampires to murder, the city threatens to tear itself apart. Only an unlikely alliance with former opponents can give Alex and Marcus a fighting chance against an ancient vampire conspiracy. </p> <p>If they succeed, they'll be pariahs, hunted by everyone. If they fail, the result will be a race war bloodier than any the world has ever seen. </p>"; 
